// bootstrap 5

import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Card from "./Card";

const App = () => {
  return (
    <>
      <h1 className="text-center"> Welcome </h1>
      <Card
        title="Taj mahal"
        imgsrc="https://upload.wikimedia.org/wikipedia/commons/thumb/b/bd/Taj_Mahal%2C_Agra%2C_India_edit3.jpg/500px-Taj_Mahal%2C_Agra%2C_India_edit3.jpg"
        note="Taj Mahal is the great example of civil engineer and it is the sign of Love."
        link="https://en.wikipedia.org/wiki/Taj_Mahal"
      />
    </>
  );
};

export default App;
